&quot;Until you find someone you like more than me, once a year, on your birthday, I will go on a date with you&quot;

These are the words Hayate spoke to Takashi, after being confessed to by the latter on the day of their high school graduation. It has been ten years since then, and Hayate has diligently followed through with his promise to Takashi, but instead of his feelings fading away &ndash; they've only increased. Thinking that he cannot continue with this unrequited love toward his straight friend, Takashi lies to Hayate saying: &quot;I've found someone I love...&quot;

A sad, provoking and erotic story of unrequited love moved by friendship and desires.

City boy Chiaki was asked to take on a big project by his grandfather and sent to Tokachi, Hokkaido. However, upon his arrival at the project site, Chiaki is met with farming land full of cattle&hellip; the countryside?!

In order to help the spoiled Chiaki mature, his grandfather tells him to &quot;earn enough money to pay for your flight home.&quot;

In front of a hopeless Chiaki appears the extremely tall Soichiro, who was under the impression that he was going to be living with a girl who would be undergoing bridal training?!

Apart from the fact he's in the student council and has quite strange tastes, Shima is an average, low-profile, quiet high schooler. Therefore, he doesn't understand why Ryuunosuke, a sports student, always glares at him every time they cross paths. Shima doesn't want to draw the punk's attention, but the instinctive hostility of Ryuunosuke towards him troubles him, and he wants to know why the other boy hates him.
