[spoiler]Shima, członek samorządu uczniowskiego, ma dość dziwny gust jak na zwykłego, niczym nie wyr&oacute;żniającego się, spokojnego chłopaka. Pewnego razu zauważa, że Ryuunosuke, uczeń wydziału sportowego, bez przerwy się na niego gapi. Shima zdecydowanie wolałby, żeby taki łobuz nie interesował się nim zbytnio, a wrogie spojrzenie Ryuu coraz bardziej mu przeszkadza, zwłaszcza, że nie ma bladego pojęcia, dlaczego ten chłopak tak go nienawidzi&hellip;

&quot;They do not care even if I can see their panties!&quot; 

High school student Daisuke Kaji, who is bad with gals, was made to deliver something to the house of the biggest monster gal, Chiriko Iega. Forced to bring Iega to her bedroom Kaji is shocked by her unimaginably filthy room! After being amazed by the level of cleaning knowledge Kaji demonstrated Iega extorts him into cleaning her entire room!

The beginning of a gal love comedy!

&ldquo;It&rsquo;s my job to satisfy you, isn&rsquo;t it?&rdquo;

&ldquo;Seme College student x Gay Proofreader&rdquo;

Gay proofreader Yusaku Odoriba, due to shock of being heartbroken, impulsively went to Taketomi Island.

Meeting a beautiful older man, &ldquo;because it is easy to shrug off the shame of travels&rdquo; he did all sorts of things.

Thinking he would never see him again, they unexpectedly reunite in Tokyo. Kyouichi Yayoi, the person he thought was older, turned out to be a college student of Architecture. With the awkwardness of the situation, he tried to avoid him, but Yayoi pushes on aggressively instead!

&quot;...I'm afraid of nightmares and can't sleep.&quot;

In his childhood, insomniac Kazushi was plagued with terrible nightmares. But when he hears the low and gentle voice of his colleague Wabuka, he's lured into drowsiness... so much so that he falls into a faint. Knowing that Kazushi is able to fall into a deep sleep when he's with him, Wabuka suddenly blurts out: &quot;Shall we live together?!&quot;

To Isshi, two men in their thirties living together and sleeping belly to belly is unthinkably strange, but Wabuka is rapidly becoming very precious to him.

From MangaHelpers:

Alice and Ruka are heading to an exclusive girl's boarding school together! They realize they may be in over their heads when they arrive at the opening ceremony, where they see that there are markedly less students in each increasing year. Their school dreams turn to nightmares when the ceremony concludes with the student council president executing a student for wearing a slightly too short skirt. Her shattered head explodes into sweets. One thing follows another on that terrifying first day and night, as friendships are betrayed, new allies are found, and Alice obtains a mysterious chainsaw named &quot;Ibara-hime.&quot; Will Alice be able to survive her new school life? [tethysdust]


Alternate summary by the scanlator: &quot;Lesbian school girls murder each other with deadly weapons and explode into candy.&quot;

&quot;Do you know that the cherry blossoms are so beautiful because of the corpses buried under them?&quot;

Teenaged Subaru Sumeragi is the 13th head of the Sumeragi clan. Together with his twin sister Hokuto and the 
mysterious veterinarian Seishirou, Subaru travels around Tokyo, calming the ghosts that threaten the city.

